// individual User which gets imported into Users.js
const User = ({ id, login, avatar_url, html_url }) => {
  return (
    <li key={id}>
      <img src={avatar_url} alt={login} />
      <div>
        <h4>{login}</h4>
        <a href={html_url}>Profile</a>
      </div>
    </li>
  );
};

export default User;
